import React from "react";

{/* Exemple d'utilisation de const avec des props */}
const PremiereConst = props => (
    <div>
        <p>Vient de ma première constante</p>
    </div>
) 

export default PremiereConst;               

{/* Exemple d'utilisation de classe 

